script: |
  super -f text -I q8134.spq | sort > q8134.out

inputs:
  - name: q8134.spq
    data: |
      SELECT DISTINCT - - col0 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE 85 NOT IN ( + - col0 * col1, 87, - 27 + ( - col0 ) - - col1 );
  - name: tab2

outputs:
  - name: q8134.out
    data: |
      46
      64
      75
